import React from "react";
function Cart(props){
    return(
        <div className="card">
            <img className="card-img-top" src="https://picsum.photos/100" alt="pictur"/>
            <div className="card-body">
                <h3>name : {props.name}</h3>
                <h3>phone : {props.phon}</h3>
                <h3>Email : {props.email}</h3>



            </div>

        </div>




    );

}
export default Cart;
